import React from "react";
import ReactDOM from "react-dom";
import { BrowserRouter } from "react-router-dom";
import { Web3Provider } from "@chainsafe/web3-context";
import App from "App";

ReactDOM.render(
  <BrowserRouter>
    <Web3Provider
      networkIds={[1001011]}
      tokensToWatch={{
        1001011: [
          {
            address: "0x790d3e47DEb51F08a0431B7B9EFDB82E7d78764E",
            name: "HunterDAO ETHDenver Closeout Party",
            symbol: "TIX",
          },
        ],
      }}
      onboardConfig={{
        darkMode: true,
        hideBranding: true,
      }}
    >
      <App />
    </Web3Provider>
  </BrowserRouter>,
  document.getElementById("root")
);
